// src/components/ProductList.js
import React from 'react';
import Product from './Product';

function ProductList({ onAddToCart }) {
  const products = [
    { id: 1, name: 'Produkt 1', description: 'Beskrivning av produkt 1', price: 100, image: 'https://via.placeholder.com/150' },
    { id: 2, name: 'Produkt 2', description: 'Beskrivning av produkt 2', price: 200, image: 'https://via.placeholder.com/150' },
    { id: 3, name: 'Produkt 3', description: 'Beskrivning av produkt 3', price: 150, image: 'https://via.placeholder.com/150' },
    { id: 4, name: 'Produkt 4', description: 'Beskrivning av produkt 4', price: 250, image: 'https://via.placeholder.com/150' },
    { id: 5, name: 'Produkt 5', description: 'Beskrivning av produkt 5', price: 300, image: 'https://via.placeholder.com/150' },
    { id: 6, name: 'Produkt 6', description: 'Beskrivning av produkt 6', price: 350, image: 'https://via.placeholder.com/150' },
  ];

  return (
    <div className="row row-cols-1 row-cols-md-3 g-4">
      {products.map(product => (
        <div className="col" key={product.id}>
          <Product product={product} onAddToCart={onAddToCart} />
        </div>
      ))}
    </div>
  );
}

export default ProductList;
